  //     email: email,
  //     handle: handle,
  //     username: username,
  //     //subscribedBlogs: []
  //   }
  //   var url = "http://localhost:9000/user/create";
  //   axios.post(url, {
  //     "handle" : newUser.handle,
  //     "userName" : newUser.username,

  //     "email" : newUser.email
      
  //   }).then(response => {
  //     if(response.status === 200){
  //         // Logic for data refresh
  //     }
  //   });

  // }
  const AddUser = () => {
  // const email = document.getElementById('email').value;
  // const handle = document.getElementById('handle').value;
  // const username = document.getElementById('username').value;
  const bcrypt = require("bcrypt");
  bcrypt.hash(document.getElementById('password'), 10).then((hashedPassword) => {
    const email = document.getElementById('email').value;
  const handle = document.getElementById('handle').value;
  const username = document.getElementById('username').value;
    const newUser = {
      email: email,
      handle: handle,
      username: username,
      password: hashedPassword,
    };
    var url = "http://localhost:9000/user/create";
    axios.post(url, {
      "handle": newUser.handle,
      "userName": newUser.username,
      "email": newUser.email,
      "password":newUser.password
    }).then(response => {
      if (response.status === 200) {
        // Logic for data refresh
      }
    });
})
.catch((e) => {
  response.status(500).send({
    message: "Password was not hashed successfully",
    e,
  });
});
;

  // const newUser = {
  //   email: email,
  //   handle: handle,
  //   username: username,
  //   password: password
  //   //subscribedBlogs: []
  // };

  // var url = "http://localhost:9000/user/create";
  // axios.post(url, {
  //   "handle": newUser.handle,
  //   "userName": newUser.username,
  //   "email": newUser.email,
  //   "password":newUser.password
  // }).then(response => {
  //   if (response.status === 200) {
  //     // Logic for data refresh
  //   }
  // });
};

  const handleSignInClick = () => {
    navigate('/'); // Navigate to signin page
  };
  return (
    <ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Sign up
          </Typography>
          <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 3 }}>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
                <TextField
                  autoComplete="given-name"
                  name="firstName"
                  required
                  fullWidth
                  id="username"
                  label="Username"
                  autoFocus
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  required
                  fullWidth
                  id="handle"
                  label="Codeforces Handle"
                  name="lastName"
                  autoComplete="family-name"
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="email"
                  label="Email Address"
                  name="email"
                  autoComplete="email"
                />
              </Grid>
               <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="new-password"
                />
              </Grid> 
              <Grid item xs={12}>
                <FormControlLabel
                  control={<Checkbox value="allowExtraEmails" color="primary" />}
                  label="I want to receive inspiration, marketing promotions and updates via email."
                />
              </Grid>
            </Grid>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
              onClick={()=>AddUser()}
            >
              Sign Up
            </Button>
            <Grid container justifyContent="flex-end">
              <Grid item>
                <Link variant="body2"  onClick={handleSignInClick}>
                  Already have an account? Sign in
                </Link>
              </Grid>
            </Grid>
          </Box>
        </Box>
        <Copyright sx={{ mt: 5 }} />
      </Container>
    </ThemeProvider>
  );
}
